import React from 'react';
import { Box, Container, Button, Grid, Paper } from '@mui/material';

import Hero from '../../Hero/Hero';
import Footer from '../../Footer/Footer';

const useStyles = makeStyles((theme) => ({
  textContent: {
    alignSelf: 'center',
    marginTop: '0px',
    paddingLeft: theme.spacing(5),
  },
  image: {
    textAlign: 'right',
    alignSelf: 'center',
    padding: theme.spacing(2),
  },
  card: {
    backgroundColor: '#999',
    margin: '15px 15px 0px 15px',
  },
  logoCard: {
    margin: '15px 7.5px 0px 7.5px',
    padding: theme.spacing(1),
    textAlign: 'center',
    position: 'relative',
  },
  logo: {
    width: '200px',
    height: '200px',
    objectFit: 'contain',
  },
  logoBig: {
    width: '125px',
    height: '200px',
    objectFit: 'contain',
  },
}));

const Projects = (props) => {
  const classes = useStyles();

  const heading = 'Projects';
  const caption = 'This is my Projects';
  const image =
    'https://images.pexels.com/photos/372787/pexels-photo-372787.jpeg?cs=srgb&dl=pexels-pixabay-372787.jpg&fm=jpg';
  const btnLeft = 'Education';
  const btnRight = 'Contact';
  return (
    <Box>
      <Hero
        heading={heading}
        caption={caption}
        image={image}
        btnLeft={btnLeft}
        btnRight={btnRight}
      />
      <Paper>
        <Box>BMI Calculator</Box>
      </Paper>
      <Footer />
    </Box>
  );
};

export default Projects;
